import React, { useState } from 'react';

  const App=()=>{
     const state = useState();
     const [ c , count]= useState(0);
     const IncNum =()=>{
        count(c ++)
     }

     return(<>
        <h1>{c}</h1>
        <button onClick={IncNum}>click here</button>
     </>)
  }



export default Apps;
